import { Resume} from './components/Resume';
import Navbar from './components/Navbar';

function App ()  {

  return (
    <div className="App">
    <Particles
    params={{
      particles: {
        number: {
          value: 30,
          density: {
            enable: true,
            value_area: 900
          }
        },
        shape: {
          type: "circle",
          stroke: {
            width: 6,
            color : "#f9ab00"
          }
        }

      } 

  }}


    />
<Navbar />

      <Header />
<About />
<Resume />
    </div>

    )
}

export default App;
